import './App.css';
import Image from './Image'

function App() {
  const url = 'https://cdn.pixabayx.com/photo/2017/02/20/18/03/cat-2083492_1280.jpg';
  return (
   <main>
    <Image source ={ url } alternativeText={ 'Cute cat staring' }/>
   </main>
  );
}

export default App;
